    false,nt"url": null,nt"notes": "This digital data set defines the hydraulic-head
    values in 16 model layers used to initiate the transient simulation of the Death
    Valley regional ground-water flow system (DVRFS) model. The area simulated by the
    DVRFS transient ground-water flow model is an approximately 45,000 square-kilometer
    region of southern Nevada and California. In order to reduce model execution time,
    hydraulic head values output from the steady-state simulation of the DVRFS were
    used as starting hydraulic heads for the transient simulation of the DVRFS ground-water
    flow model. The DVRFS transient ground-water flow model is one of the most recent
    in a number of regional-scale models developed by the U.S. Geological Survey (USGS)
    for the U.S. Department of Energy (DOE) to support investigations at the Nevada
    Test Site (NTS) and at Yucca Mountain, Nevada (see "Larger Work Citation", Chapter
    A, page 8).",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
